import React, {Component} from "react";

class Task extends Component{
    render(){
        const {task} = this.props.task;
        return(
            <div>
              <p>{this.props.task.id} - {this.props.task.titulo} - {String(this.props.task.done)}</p>
              <input type="checkbox"/>
              <button>
                  Button
              </button>
            </div> 
        )
    }
    
}

export default Task;
